import React, { useState } from "react";

function ToDoItem(props) {
  var [strike, changeStrike] = useState(false);

  function clicked() {
    if (strike) {
      changeStrike(false);
    } else {
      changeStrike(true);
    }

    props.deleteIt(props.id);
  }

  return (
    <li
      onClick={clicked}
      style={{ textDecoration: strike ? "line-through" : null }}
      key={props.index}
    >
      {props.name}
    </li>
  );
}

export default ToDoItem;
